import { FaFireAlt, FaCheckCircle } from "react-icons/fa";

const pricingData = [
  {
    title: "Professional",
    price: "$98.00",
    description: "Best for growing startups and growth companies",
    features: [
      "Everything in Free",
      "Customizable Dashboards",
      "Advanced Budgeting",
      "Enhanced Security",
    ],
    icon: FaFireAlt,
    checkIcon: FaCheckCircle,
  },
  {
    title: "Enterprise",
    price: "$149.00",
    description: "Scalable tools for large businesses",
    features: [
      "All Professional features",
      "Dedicated Account Manager",
      "API Access",
      "Premium Support",
    ],
    icon: FaFireAlt,
    checkIcon: FaCheckCircle,
  },
  {
    title: "Starter",
    price: "$49.00",
    description: "Perfect for individuals or new teams",
    features: [
      "Basic Analytics",
      "Unlimited Boards",
      "Community Support",
      "File Sharing",
    ],
    icon: FaFireAlt,
    checkIcon: FaCheckCircle,
  },
];

export default pricingData;
